import {useEffect, useState} from 'react'
import axios from 'axios'


const FetchProducts = () => {
    const [product, setProduct] = useState([]);
    useEffect(() => {
      getProduct();
    }, []);
  
    const getProduct = () => {
      axios
        .get("products.json")
        .then((response) => {
          setProduct(response.data);
        })
        .catch((error) => {
          console.log(error);
        });
    };
};

export default FetchProducts;
